class Solution(object):
    def longestCommonPrefix(self, strs):
        longComPrefix = strs[0]
        longestWord = 200
        while longComPrefix != "" and longestWord >= 0:
            for str in strs:
                if str.startswith(longComPrefix) != True or str == "":
                    longComPrefix = longComPrefix[:-1]
            longestWord = longestWord - 1
        return longComPrefix
    
